import React from "react";
import { BrowserRouter, Routes, Route, Link } from "react-router-dom";
import Register from "./components/Register";
import Login from "./components/Login";
import Dashboard from "./components/Dashboard";
import NotFound from "./components/NotFound"; // Assuming you create this component
import Home from "./components/Home"; // Assuming you create this component

function App() {
  return (
    <BrowserRouter>
      <nav>
        {/* Navigation links */}
        <Link to="/">Home</Link> | <Link to="/login">Login</Link> | <Link to="/register">Register</Link> | <Link to="/dashboard">Dashboard</Link>
      </nav>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="" element={<NotFound />} /> {/ Catch-all route for 404 pages */}
      </Routes>
    </BrowserRouter>
  );
}

